import re

def extract_unique_six_digit_numbers(text):
    # Usamos una expresión regular para encontrar números de 6 dígitos
    numbers = re.findall(r'\b\d{6}\b', text)
    
    # Convertimos a un conjunto para eliminar duplicados
    unique_numbers = set(numbers)
    
    return unique_numbers

